INSERT INTO `Movies` (`movieID`, `typeID`, `Name`, `director`, `performer`, `time`, `language`, `premiere`, `describes`, `cost`, `image`, `url`) VALUES
(1, 2, 'THIẾU NIÊN VÀ CHIM DIỆC', 'Miyazaki Hayao', 'Santoki Soma, Suda Masaki, Shibasaki Ko, Aimyon, Kimura Yoshino, Kimura Takuya, Kobayashi Karou', '124 phút', 'Tiếng Nhật - Phụ đề Tiếng Việt', '2023-12-15', 'Đến từ Studio Ghibli và đạo diễn Miyazaki Hayao, bộ phim là câu chuyện về hành trình kỳ diệu của cậu thiếu niên Mahito trong một thế giới hoàn toàn mới lạ. Trải qua nỗi đau mất mẹ cùng mối quan hệ chẳng mấy vui vẻ với gia đình cũng như bạn học, Mahito dần cô lập bản thân... cho đến khi cậu gặp một chú chim diệc biết nói kỳ lạ. Mahito cùng chim diệc bước vào một tòa tháp bí ẩn, nơi một thế giới thần kỳ mở ra, đưa cậu gặp gỡ những người mình yêu thương... trong một nhân dạng hoàn toàn khác.', 50000, 'images/thieunien.jpg', 'https://www.youtube.com/embed/eggzAobZzHc'),
(2, 1, 'KẺ ĂN HỒN', 'Trần Hữu Tấn', 'Hoàng Hà, Võ Điền Gia Huy, Huỳnh Thanh Trực, NSƯT Chiều Xuân, Nghệ sĩ Viết Liên, NSND Ngọc Thư, Nguyễn Hữu Tiến, Nguyễn Phước Lộc, Nghinh Lộc, Lý Hồng Ân, Vũ Đức Ngọc…', '109 phút', 'Tiếng Việt - Phụ đề Tiếng Anh', '2023-12-15', 'Phim về hàng loạt cái chết bí ẩn ở Làng Địa Ngục, nơi có ma thuật cổ xưa: 5 mạng đổi bình Rượu Sọ Người. Thập Nương - cô gái áo đỏ là kẻ nắm giữ bí thuật luyện nên loại rượu mạnh nhất!', 65000, 'images/keanhon.jpg', 'https://www.youtube.com/embed/xWh0g4rKGjI'),
(3, 3, 'PHI CÔNG SIÊU ĐẲNG MAVERICK', 'Joseph Kosinski', 'Tom Cruise, Justin Marks, Peter Craig, Eric Warren Singer', '130 phút', 'Tiếng Anh - Phụ đề Tiếng Việt; Lồng tiếng Việt', '2023-12-23', 'Sau hơn ba mươi năm phục vụ, Pete “Maverick” Mitchell từng nổi danh là một phi công thử nghiệm quả cảm hàng đầu của Hải quân, né tránh cơ hội thăng chức, điều khiến anh cảm thấy bị bó buộc, để trở về làm chính mình.', 50000, 'images/phicong.jpg', 'https://www.youtube.com/embed/ZR99nOkEolM'),
(4, 4, 'WONKA', 'Paul King', 'Timothée Chalamet, Hugh Grant, Rowan Atkinson, Matt Lucas, Mathew Baynton.', '116 phút', 'Tiếng Anh - Phụ đề Tiếng Việt; Lồng tiếng Việt', '2023-12-08', 'Dựa trên nhân vật từ quyến sách gối đầu giường của các em nhỏ trên toàn thế giới \"Charlie và Nhà Máy Sôcôla\" và phiên bản phim điện ảnh cùng tên vào năm 2005, WONKA kể câu chuyện kỳ diệu về hành trình của nhà phát minh, ảo thuật gia và nhà sản xuất sôcôla vĩ đại nhất thế giới trở thành WILLY WONKA đáng yêu mà chúng ta biết ngày nay. Từ đạo diễn loạt phim Paddington và nhà sản xuất loạt phim chuyển thể đình đám Harry Potter, WONKA hứa hẹn sẽ là một bộ phim đầy vui nhộn và màu sắc cho khán giả dịp Lễ Giáng Sinh năm nay.', 65000, 'images/wonka.jpg', 'https://www.youtube.com/embed/1JHj4hc5MEI'),
(5, 5, 'YÊU LẠI VỢ NGẦU', 'Nam Dae-jung', 'Kang Ha-neul, Jung So-min, Kim Sun-young, Lim Chul-hyung, Yoon Kyung-ho, Jo Min-soo,....', '119 phút', 'Tiếng Hàn - Phụ đề tiếng Việt, tiếng Anh', '2023-12-10', 'Cặp vợ chồng trẻ No Jung Yeol (Kang Ha-neul) và Hong Na Ra (Jung So-min) từ cuộc sống hôn nhân màu hồng dần “hiện nguyên hình” trở thành cái gai trong mắt đối phương với vô vàn thói hư, tật xấu. Không thể đi đến tiếng nói chung, Jung Yeol và Na Ra quyết định ra toà ly dị. Tuy nhiên, họ phải chờ 30 ngày cho đến khi mọi thủ tục chính thức được hoàn tất. Trong khoảng thời gian này, một vụ tai nạn xảy ra khiến cả hai mất đi ký ức và không nhớ người kia là ai. 30 ngày chờ đợi để được “đường ai nấy đi” nhưng nhiều tình huống trớ trêu khiến cả hai bắt đầu nảy sinh tình cảm trở lại. Liệu khi nhớ ra mọi thứ, họ vẫn sẽ ký tên vào tờ giấy ly hôn?', 65000, 'images/yeuvo.jpg', 'https://www.youtube.com/embed/081I7DXNknc'),
(6, 3, 'NGƯỜI MẶT TRỜI', 'Timothy Linh Bui', 'Chi Pu, Thuận Nguyễn, Trần Ngọc Vàng, Trịnh Thảo', '115 phút', 'Tiếng Việt - Phụ đề Tiếng Anh', '2023-12-08', '400 năm qua, loài Ma Cà Rồng đã bí mật sống giữa loài người trong hòa bình, nhưng hiểm họa bỗng ập đến khi một cô gái loài người phát hiện được thân phận của hai anh em Ma Cà Rồng. Người anh khát máu quyết săn lùng cô để bảo vệ bí mật giống loài, trong khi người còn lại chạy đua với thời gian để bảo vệ cô bằng mọi giá.', 75000, 'images/nguoi.jpg', 'https://www.youtube.com/embed/L3t9jW4eRAs');
